import React from 'react';
import logo from '../../photos/logo/logoHD-transformed.png'
import cl from './Navbar.module.css'

const Navbar = () => {
    return (
        <div className={cl.navbar}>
                <img src={logo} alt="Gekon" className='logo' />
            <div className={cl.barlist}>
                <ul>
                    <li>О нас</li>
                    <li>Колонки</li>
                    <li>Портфолио</li>
                    <li>Услуги</li>
                    <li>Контакты</li>
                </ul>
            </div>
        </div>
    );
};

export default Navbar;
